INSERT INTO articles VALUES
(1, 9, 1, 1458636772, 0, 'Артем', 'Тестовая новость 1', '<div style="text-indent: 2em;">\r\n<p><span style="font-size:18px">Поздравляем всех читателей &laquo;Сільського вісника&raquo; с праздником Весны</span><span style="font-size:14px">, с началом долгожданного начала посевов, забот и планов на новый урожай 2016 года. <strong><span style="color:#FF0000">Начиная с этого выпуска газеты все предложенные растения будут отправляться осенью.</span></strong></span></p>\r\n\r\n<p><span style="font-size:14px">Для любителей <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0304&amp;page=0"><strong>крупноплодной земляники</strong></a> (клубники) мы подготовили каталог для посадки осенью. В нем вы найдете новейшие гибриды и сорта, стремительно завоевывающие своих поклонников. Огромную популярность приобрели сорта нейтрального светового дня, которые плодоносят на протяжении всего сезона. Рассада будет поставляться в кассетах на шесть ячеек в августе &ndash; сентябре этого года.</span></p>\r\n\r\n<p><span style="font-size:14px">Дорогие любители комнатных растений! Для вас мы подготовили каталог неприхотливых комнатных орхидей &ndash; <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0302&amp;page=0"><strong>фаленопсисов</strong></a>. Это будут молодые, до стадии цветения, растения в горшках.</span></p>\r\n\r\n<p><span style="font-size:14px">Современные сорта <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0306&amp;page=0"><strong>цикламенов</strong></a> поражают не только формой и окраской цветов, но и великолепием листвы. В нашем каталоге вы найдете сорта на любой вкус и размер &ndash; гигантские и миниатюрные сорта.</span></p>\r\n\r\n<p><span style="font-size:14px">Красочные, обильноцветущие кустики современных гибридных <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0301&amp;page=0"><strong>примул</strong></a> оживляют дом яркими красками, дарят радостное ожидание весны и могут поспорить по красоте со многими традиционными комнатными растениями, а с наступлением первого весеннего тепла украсят оконные ящики, балконы и цветники в саду. Молодые примулы вы получите в горшочках осенью этого года.</span></p>\r\n\r\n<p><span style="font-size:14px">Не забыли мы и другие <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0305&amp;page=0"><strong>комнатные растения</strong></a>, которые будут отправлены своим заказчикам в первой половине осени 2016 года. Обратите внимание на пока еще редкий на наших подоконниках аспарагус серповидный. А рождественская звезда (пуансеттия прекрасная), при соблюдении агротехники выращивания, порадует вас своим цветением как раз на зимние праздники.</span></p>\r\n\r\n<p><span style="font-size:14px">Также для осенней поставки предлагаем каталог <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0303&amp;page=0"><strong>декоративных деревьев и кустарников</strong></a>. Эти растения выращены в Украине, поэтому они легче и быстрее приживутся в ваших садах. Все декоративные деревья и кустарники вы получите с закрытой корневой системой. Обратите внимание на сциадопитис мутовчатый &mdash; это красивое растение действительно редкость, и его нелегко достать.</span></p>\r\n\r\n<p><strong><span style="font-size:18px"><span style="color:#FFFFFF"><span style="background-color:#FF0000">Минимальная сумма заказа по каждому каталогу &ndash; 75 грн. Заявки присылайте до 1 июля.</span></span></span></strong></p>\r\n</div>\r\n'),
(2, 9, 1, 1458636772, 0, 'ввапва', 'вапвапва', '<div style="border-width: 1pt; padding: 6pt;">\r\n<p><span style="color:#FFFF00"><span style="font-size:18px"><strong><span style="font-family:arial,sans-serif"><span style="background-color:#0000FF">&nbsp;До уваги учбовим закладам міністерства освіти,&nbsp;науки та культури України!!!&nbsp;</span></span></strong></span></span></p>\r\n\r\n<p><span style="font-family:arial,sans-serif; font-size:10pt">Усі заклади України, що замовлять від п&#39;яти наборів &quot;Прапор України&quot; і приймуть участь у всеукраїнській акції &quot;Прапор України - Прапор миру&quot; <strong><span style="color:#FF0000"><span style="font-size:14px">на протязі п&#39;яти&nbsp;років</span></span></strong>, до 30-ти річчя Дня Незалежності України 2021 року,&nbsp;<span style="font-size:14px"><strong><span style="color:#FF0000">безкоштовно будуть отримувати насіння квітів</span></strong></span> (жовті чорнобривці, петунія блакитна або агератум блакитний), для створення на своїй клумбі Прапора України з живих квітів <span style="color:#FF0000"><strong><span style="font-size:14px">площею до 5-ти м<sup>2</sup>.</span></strong></span></span></p>\r\n</div>\r\n'),
(3, 1, 0, 1458636772, 1468220818, 'Сільський вісник', 'Мартовский каталог ', '<div style=";background-color:#66CD00; padding:20px;">\r\n<h2 style="font-style:italic; text-align:center"><span style="color:#FFFFFF"><span style="font-size:22px"><span style="font-family:georgia,serif"><strong>Поздравляем всех клиентов &laquo;Сільського вісника&raquo; с приходом Весны и началом долгожданного начала посевов, забот и планов на новый урожай 2016 года.&nbsp;</strong></span></span></span></h2>\r\n</div>\r\n\r\n<p>&nbsp;Для любителей&nbsp;<a href="http://cib.net.ua/catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0304&amp;page=0"><strong>крупноплодной земляники</strong></a>&nbsp;(клубники) мы подготовили каталог для посадки осенью. В нем вы найдете новейшие гибриды и сорта, стремительно завоевывающие своих поклонников. <img alt="" src="вавапвап" style="float:left; height:100px; width:200px" /></p>\r\n\r\n<div>Дорогие любители комнатных растений! Для вас мы подготовили каталог неприхотливых комнатных орхидей &ndash;&nbsp;<a href="http://cib.net.ua/catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0302&amp;page=0"><strong>фаленопсисов</strong></a>. Это будут молодые, до стадии цветения, растения в горшках.</div>\r\n\r\n<p>Современные сорта&nbsp;<a href="http://cib.net.ua/catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0306&amp;page=0"><strong>цикламенов</strong></a>&nbsp;поражают не только формой и окраской цветов, но и великолепием листвы.&nbsp;</p>\r\n\r\n<p>Красочные, обильноцветущие кустики современных гибридных&nbsp;<a href="http://cib.net.ua/catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0301&amp;page=0"><strong>примул</strong></a>&nbsp;оживляют ваш дом яркими красками. <img alt="" src=" мвавапвап" style="float:right; height:100px; width:200px" /></p>\r\n\r\n<p>Не забыли мы и другие&nbsp;<a href="http://cib.net.ua/catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0305&amp;page=0"><strong>комнатные растения</strong></a>, которые будут отправлены своим заказчикам в первой половине осени 2016 года.</p>\r\n\r\n<p>Также для осенней поставки предлагаем каталог&nbsp;<a href="http://cib.net.ua/catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=032016&amp;ucat=0303&amp;page=0"><strong>декоративных деревьев и кустарников</strong></a>. Эти растения выращены в Украине, поэтому они легче и быстрее приживутся в ваших садах. Все декоративные деревья и кустарники вы получите с закрытой корневой системой.&nbsp;</p>\r\n\r\n<p><span style="color:#FF0000"><strong>Внимание!</strong></span></p>\r\n\r\n<p><span style="color:#FF0000"><strong>Начиная с этого каталога все предложенные растения будут отправляться осенью.</strong></span></p>\r\n\r\n<p><span style="color:#FF0000"><strong>Минимальная сумма заказа по каждому каталогу &ndash; 75 грн.</strong></span></p>\r\n\r\n<p><span style="color:#FF0000"><strong>Заказы присылайте до 1 июля.</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
