(9, 1, 1, 1460374495, 1468220850, 'Йа', 'Апрельский каталог посадочного материала', '<div style="text-indent:3em;">\r\n<p>Время весенних забот: рассада, сад, огород и, естественно, планирование на будущее. В апрельском выпуске &laquo;СВ&raquo; - осенние луковичные. Посмотрите сейчас, запишите &ndash; какие клумбы, уголочки сада желательно преобразовать, что пересадить, а что и заказать из наших каталогов.</p>\r\n\r\n<p>Декоративные луковичные растения &ndash; самые прекрасные и востребованные цветы, которые мы выращиваем в своих садах. <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=042016&amp;ucat=0406&amp;page=0"><strong>Тюльпаны</strong></a> украшают наши цветники не одно столетие, но они по-прежнему желанны. Это можно сказать и о <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=042016&amp;ucat=0404&amp;page=0"><strong>нарциссах</strong> </a>ведь &ndash; обилие и разнообразие их сортов просто завораживает.</p>\r\n\r\n<p>Одними из первых, сразу после схода снега, открываются <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=042016&amp;ucat=0401&amp;page=0"><strong>крокусы</strong></a>. Заметьте, в нашем предложении есть и осеннецветущие крокусы. В наших каталогах вы найдете и ароматные <strong><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=042016&amp;ucat=0403&amp;page=0">гиацинты</a>. </strong>Они легко выращиваются в домашних условиях к весенним праздникам.</p>\r\n\r\n<p>Не забыли мы и о десятках видов <strong><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=042016&amp;ucat=0405&amp;page=0">других осенних луковичных</a>. </strong>Мускари и камассия, ириодиктиумы и кандыки, нектароскордум и разнообразные виды луков, рябчики и пролески, хионодоксы и хохлатки и многие, многие другие луковичные растения смогут украсить ваш сад уже будущей весной.</p>\r\n\r\n<p>Из комнатных цветов в это время мы традиционно предлагаем <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=042016&amp;ucat=0402&amp;page=0"><strong>гиппеастумы</strong> </a>&ndash; ведь их период покоя совпадает с отправкой осенних луковичных.</p>\r\n\r\n<div style="color:#FFFFFF;background-color:red; padding: 5px; font-weight: bold; ">Заявки принимаем до 1 июля 2016 г. Отправка &mdash; в начале осени текущего года. Минимальная общая сумма заказа по всем, без исключения каталогам &mdash; 75 грн.</div>\r\n</div>\r\n'),
(10, 1, 0, 1462515885, 1468221036, 'Artem', 'Майский каталог посадочного материала', '<p>Дорогие друзья! Несмотря на то, что весна в полном разгаре и еще не закончился посадочный сезон, пришло время позаботиться и об урожае следующего, 2017 года! Мы рады предложить вам <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=052016&amp;ucat=0505&amp;page=0"><strong>лук-севок и чеснок</strong></a> для подзимней посадки, главное преимущество которого &ndash; самое раннее поступление урожая из открытого грунта (конец мая &ndash; начало июня). Этот лук часто выращивают на продажу, ведь цена на него в начале лета самая высокая. Севок высаживают в середине (конце) октября, на неделю-две позже озимого чеснока, с таким расчетом, чтобы луковицы укоренились, но не проросли. С наступлением морозов грядку желательно укрыть листвой, торфом, сосновыми иголками и т. п. Обратите внимание и на новые, урожайные сорта чеснока.</p>\r\n\r\n<h3><span style="color:#ffffff"><strong><span style="background-color:#FF0000">Ваши заявки &nbsp;на лук-севок и чеснок&nbsp;ожидаем до 1 июля.</span></strong></span></h3>\r\n\r\n<p>Осень &mdash; лучшее время посадки для многих многолетних зимостойких цветов. Для этого мы подготовили новые предложения таких популярных цветочных культур как <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=052016&amp;ucat=0503&amp;page=0"><strong>пионы</strong></a>, роскошные <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=052016&amp;ucat=0502&amp;page=0"><strong>лилейники</strong></a>, ошеломляюще красивые <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=052016&amp;ucat=0501&amp;page=0"><strong>маки</strong> </a>и разнообразные <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=052016&amp;ucat=0504&amp;page=0"><strong>ирисы</strong> </a>современной селекции. В наши каталоги вошли сорта, посадочный материал которых выращен как в Голландии, так и в Украине. По многочисленным просьбам наших читателей мы расширили ассортимент пионов Ито-гибриды, а также добавили интереснейшие новинки травянистых пионов. В каталог лилейников, которые в последние годы очень популярны в нашей стране, мы включили несколько новинок европейской селекции, а также наиболее популярные сорта, которые ранее предлагались в наших каталогах. А каталог ирисов разнообразили сортами ириса сибирского, которые при систематическом поливе способны украсить практически любой цветник. Посадочный материал пионов, ирисов, маков и лилейников вы получите в первой половине осени текущего года.</p>\r\n\r\n<h3><span style="color:#ffffff"><strong><span style="background-color:#FF0000">Заявки на пионы, лилейники, маки, ирисы присылайте до 15 августа.</span></strong></span></h3>\r\n\r\n<p>Для тех, кто по каким-либо причинам не успел ранее заказать <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=052016&amp;ucat=0506&amp;page=0"><strong>цикламены</strong></a>, мы представляем еще одну возможность это сделать. Сорта предлагаем различных размеров &mdash; от крупноцветковых до миниатюрных.</p>\r\n\r\n<h3><strong><span style="color:#ffffff"><span style="background-color:#FF0000">Молодые цикламены в горшочках вы получите осенью текущего года. Заявки на цикламены присылайте до 1 июля.</span></span></strong></h3>\r\n'),
(11, 1, 1, 1467373679, 1468221055, 'Artem', 'Июльский каталог посадочного материала', '<div style="font-family:''Open Sans''">\r\n<p>Основой июльского номера &laquo;СВ&raquo; являются <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=072016&amp;ucat=0712&amp;page=0"><strong>лилии</strong> </a>&ndash; одни из самых восхитительных садовых цветов. По сравнению с прошлыми годами мы расширили каталог этих восхитительных цветов. По вашим просьбам увеличился ассортимент гибридов лилии кудреватой &ndash; сорта этой группы сейчас очень популярны, хотя и стоят не дешево из-за медленного размножения. Луковицы лилий вы получите в первой половине весны 2017 г. Заказы на лилии принимаем до 1 ноября текущего года.</p>\r\n\r\n<p>Для наших новых подписчиков мы повторяем топовые позиции <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=072016&amp;ucat=0708&amp;page=0"><strong>луковичных растений</strong></a> для осенней посадки в саду. Здесь вы найдете Различные варианты фасовок и скидки на большие упаковки будут удобны для владельцев больших садов и для тех, кто занимается выгонкой. Значком на фото В отмечены тюльпаны, пригодные для выгонки. Обратите внимание на <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=072016&amp;ucat=0702&amp;page=0"><strong>наборы луковичных растений</strong></a>, которые уже будущей весной создадут на вашей клумбе удивительно гармоничные композиции.</p>\r\n\r\n<p>Внимание огородникам! Пришло время позаботиться об урожае <a href="catalog.php?cat_mode=np&amp;cat=072016&amp;ucat=0701&amp;page=0&amp;list_mode=prev"><strong>лука и чеснока</strong></a> в будущем сезоне. Посадочный материал выращен в Голландии и Украине. Основное преимущество подзимнего выращивания лука из севка &ndash; очень раннее поступление урожая зелени и лука-репки (конец мая &ndash; начало июня). Следует учесть, что за время от расфасовки лука-севка до получения вами заказа возможно изменение веса в результате усушки.</p>\r\n\r\n<h3><span style="color:#FFFFFF"><span style="background-color:#F26522">Заказы осенние луковичные и лук-чеснок принимаем до 10 августа 2016 года. Отправка в сентябре-октябре текущего года.&nbsp;</span></span></h3>\r\n</div>\r\n'),
(12, 1, 1, 1470654308, 1470655094, 'Артем', 'Августовский выпуск «СВ» ', '<div style="font-family:''Open Sans''">\r\n<p>Рады представить очередной, августовский, выпуск &laquo;СВ&raquo;</p>\r\n\r\n<p>Основа этого номера &ndash; декоративные деревья и кустарники и в первую очередь <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=082016&amp;ucat=0801&amp;page=0"><strong>розы выращенные в Украине</strong></a>. Сюда мы включили наиболее популярные сорта прошлых сезонов и дополнили их новыми. Все представленные сорта показали хорошую зимостойкость, устойчивость к болезням в наших климатических условиях.</p>\r\n\r\n<p>Также мы предлагаем новейшие сорта <strong><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=082016&amp;ucat=0802&amp;page=0">роз от известнейших селекционных фирм &laquo;Kordes Sonne&raquo; и &laquo;Rosen Tantau&raquo;</a>. </strong>Из-за высокого обменного курса цены на саженцы этих роз немаленькие, но среди наших покупателей еще не было тех, кто разочаровался, посадив их в своем саду.</p>\r\n\r\n<p>Трудно представить современное подворье без <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=082016&amp;ucat=0803&amp;page=0"><strong>декоративных деревьев и кустарников</strong></a>. Надеемся, что наш новый каталог (а в нем множество интересных и редких растений) поможет обновить ваш сад и сделать его еще прекраснее.</p>\r\n\r\n<p>Не забыли мы и мир прекрасных <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=082016&amp;ucat=0804&amp;page=0"><strong>садовых лиан</strong></a>! Ведь они так чудесно облагораживают наши приусадебные участки! Помимо традиционных клематисов и жимолостей, в нашем каталоге вы найдете морозостойкие глицинии, съедобную и эффектную диоскорею, редчайшую родственницу гортензий &mdash; схизофрагму, а также неприхотливые княжики.</p>\r\n\r\n<p>А для огородников мы предлагаем элитные сорта <strong><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=082016&amp;ucat=0805&amp;page=0">картофеля выращенные в Украине.</a></strong></p>\r\n<span style="color:#FFFFFF"><span style="background-color:#F26522"><strong>Саженцы роз, деревьев, кустарников и лиан (с закрытой корневой системой), вы сможете получить весной будущего года. Заявки присылайте до 15 декабря текущего года.</strong></span></span></div>\r\n'),
(13, 1, 1, 1473252754, 1473253206, 'Artem', 'Сентябрьский каталог посадочного материала', '<div style="font-family:''Open Sans''">\r\n<p style="text-align:justify">Предлагаем посмотреть наши предложения, опубликованные в свежем, сентябрьском выпуске &laquo;СВ&raquo;</p>\r\n\r\n<p style="text-align:justify">Огородники могут обратить внимание коллекцию сортов и&nbsp;гибридов репчатого <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=092016&amp;ucat=0903&amp;page=0"><strong>лука-севка</strong></a> из&nbsp;Голландии. Его правильное хранение в зимний период гарантирует высокий урожай луковиц. Не забудьте и о гибридах многозачаточного лука шалота, который образует 6-10 новых крупных луковиц. <span style="color:#FFFFFF"><strong><span style="background-color:#F26522">Заявки присылайте до&nbsp;1&nbsp;декабря 2016&nbsp;года. Выполнение &mdash; март 2017&nbsp;года.</span></strong></span></p>\r\n\r\n<p style="text-align:justify">Многие стремятся завести свой виноградник. Бизнес этот довольно прибыльный, но&nbsp;даже не&nbsp;занимаясь им, а&nbsp;посадив всего одну-две сотки, вы соберете урожай солнечных ягод, которого вполне хватит для одной семьи. <strong><span style="color:#FFFFFF"><span style="background-color:#F26522">Заявки на&nbsp;посадочный материал</span></span> <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=092016&amp;ucat=0902&amp;page=0">винограда</a> <span style="color:#FFFFFF"><span style="background-color:#F26522">присылайте до&nbsp;1&nbsp;ноября 2016&nbsp;года. Отправка саженцев с&nbsp;защищенной корневой системой будет осуществляться в&nbsp;марте 2017&nbsp;года</span></span></strong></p>\r\n\r\n<p style="text-align:justify">Для цветоводов, создавая каталог <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=092016&amp;ucat=0905&amp;page=0"><strong>многолетних цветов</strong></a>, мы сделали акцент на тенелюбивых растениях, поскольку они наиболее популярны у наших читателей (по анализу заказов и писем). Особенно расширили ассортимент неприхотливых хост. Но владельцам светлых участков, а также коллекционерам редких растений нам также есть, что предложить! Все многолетние цветы вы получите будущей весной. Посадочный материал будет упакован в торф и полиэтилен. <span style="color:#FFFFFF"><strong><span style="background-color:#F26522">Заявки присылайте до 15 декабря 2016 года.</span></strong></span></p>\r\n\r\n<p style="text-align:justify"><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=092016&amp;ucat=0904&amp;page=0"><strong>Многолетние цветы в горшках</strong></a> имеют неоспоримые преимущества: компактную, но хорошо развитую корневую систему, что способствует быстрой и практически безболезненной приживаемости растений в новом месте. К тому же растения в горшках могут &laquo;подождать&raquo; достаточно долгий период времени, поскольку их не надо высаживать незамедлительно. <span style="color:#FFFFFF"><strong><span style="background-color:#F26522">Свои заявки на эту группу растений присылайте до 15 декабря 2016 года. Внимание: растения не маленькие &ndash; им от одного до двух лет! Практически все они выращены в Нидерландах.</span></strong></span></p>\r\n\r\n<p style="text-align:justify"><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=092016&amp;ucat=0901&amp;page=0"><strong>Вересковые</strong></a> &mdash; очень красивые и многоликие растения. При посадке вересковых помните, что они не выносят извести и щелочных почв. Тем читателям, кто ранее не выращивал представителей этого удивительного семейства, советуем начать свое знакомство с листопадных рододендронов. Все вересковые вы получите в горшках (более дорогие рододендроны имеют более крупные размеры) будущей весной. <span style="color:#FFFFFF"><strong><span style="background-color:#F26522">Свои заявки присылайте до 15 декабря 2016 года.</span></strong></span></p>\r\n</div>\r\n'),
(14, 1, 1, 1475844633, 1476338840, 'Артем', 'Октябрьский каталог семян овощей, цветов, и других декоративных растений', '<div style="font-family:open sans">\r\n<p>Дорогие овощеводы! Как всегда, осенью мы рады представить вашему вниманию обновленный каталог <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=102016&amp;ucat=1002&amp;page=0"><strong>семян овощей</strong></a> к новому посевному сезону. В нем вы найдете &nbsp;не только полюбившиеся сорта и гибриды овощных, бахчевых, зеленных культур, но и интересные новинки европейской и украинской селекции. Создавая каталог, мы выбираем только лучшие, проверенные сорта, которые смогут вас порадовать своей урожайностью, вкусовыми качествами, оригинальной окраской, устойчивостью к болезням и неблагоприятным условиям выращивания.</p>\r\n\r\n<p>Не забыли мы и о цветоводах. Выращивание <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=102016&amp;ucat=1001&amp;page=0"><strong>цветов из семян</strong></a> &ndash; занятие не только увлекательное, но и выгодное, ведь за небольшие деньги можно получить сразу несколько молодых растений. Все семена уже есть на складе, так что поторопитесь сделать заказ (количество некоторых семян ограничено).</p>\r\n<span style="color:rgb(255, 255, 255); font-family:open sans"><strong><span style="background-color:rgb(242, 101, 34)">&nbsp;Заказы на все семена принимаются до 31 декабря 2016 года.&nbsp;</span></strong></span><br />\r\n<span style="color:rgb(255, 255, 255); font-family:open sans"><strong><span style="background-color:rgb(242, 101, 34)">&nbsp;Выполнение ваших заявок будет осуществляться по мере поступления заказов.&nbsp;</span></strong></span></div>\r\n'),
(15, 1, 1, 1478605797, 1478769771, 'Artem', 'Ноябрьский каталог посадочного материала', '<div style="font-family:open sans; text-align: justify; text-indent: 20px;">\r\n<p>В ноябрьском выпуске &laquo;СВ&raquo;, в самое подходящее время для изучения новинок для своего сада, мы предлагаем широкий ассортимент <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1106&amp;page=0"><strong>плодовых деревьев и ягодных кустарников</strong></a>. Особого внимания заслуживают черешни отечественной селекции, которые по праву считаются самыми вкусными, витаминная и лекарственная облепиха, черная смородина с десертным сладким вкусом (&laquo;Сластена&raquo;), орехоплодные культуры и многое другое.</p>\r\n\r\n<p>Для тех, кто любит кулинарные эксперименты, ароматные блюда и напитки, мы предлагаем широкий ассортимент <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1105&amp;page=0"><strong>пряных и лекарственных культур</strong></a>. Здесь вы найдете мяты с различным ароматом листьев, природные сахарозаменители (стевию и липпию), а также редкие лекарственные растения.</p>\r\n\r\n<p>Традиционно в это время мы публикуем новый каталог <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1109&amp;page=0"><strong>луковичных растений</strong></a> для посадки будущей весной. В последние годы огромным спросом у наших читателей пользуются <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1108&amp;page=0"><strong>георгины</strong>.</a> По вашим многочисленным просьбам мы расширили их ассортимент, сделав упор на крупноцветковые сорта. Не забудьте обратить свое внимание на прекрасные сорта и новинки в каталоге <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1102&amp;page=0"><strong>ирисов</strong></a>.</p>\r\n\r\n<p>Впервые предлагаем для весенней посадки <strong><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1102&amp;page=0">бородатые ирисы</a>, </strong>от известного украинского селекционера Дмитрия Тараненко. Из его питомника вы сможете заказать и <a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1103&amp;page=0"><strong>лилейники</strong></a>, также для посадки будущей весной.</p>\r\n\r\n<p>Когда приходит весна, всем нам хочется украсить новыми растениями не только приусадебный участок, но и подоконники своего дома, балконы, террасы. Будем рады, если вы найдете себе растение по душе в каталоге <strong><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1104&amp;page=0">комнатных и однолетних цветов</a>,</strong> где представлены как красивоцветущие виды, так и растения с декоративной листвой, в том числе и новинки, которые ранее мы не предлагали. Не забыли мы и о <strong><a href="catalog.php?cat_mode=np&amp;list_mode=prev&amp;cat=112016&amp;ucat=1101&amp;page=0">садовой гербере-гарвинее и гербере-патио.</a> </strong>Посадочный материал растений вы получите в горшках в апреле-мае будущего года.&nbsp;</p>\r\n\r\n<p><span style="color:rgb(255, 255, 255); font-family:open sans"><strong><span style="background-color:rgb(242, 101, 34)">Свои заявки на посадочный материал растений присылайте до 15 февраля 2017 года.</span></strong></span></p>\r\n</div>\r\n');
